import "./App.css";

function App() {
  const userName = "Серёжик";
  const textForTexty = "Do better";

  return (
    <div className="App">
      <Myheader name={userName} />
      <Message texty={textForTexty} />
      <header className="App-header">
        <div>
          Trololo <br />
          <button
            className="button"
            autofocus
            onClick={() => console.log("You got two termal clips!")}
          >
            Нажми, чтобы стать программистом
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;

const Myheader = (props) => {
  return (
    <div>
      <h1>Привет, {props.name}</h1>
    </div>
  );
};

const Message = (texty) => {
  return (
    <div className="texty">
      <h2>Ты молодец! {texty.textForTexty} </h2>
    </div>
  );
};
